import content from './content.module.css';
import post from './post/post';
import Profile from './profile/profile';
    const Content = ()=>{
        return(
            <content className={content.main}>
                <div className="images">

                </div>
                <div className={content.container}>
                    <Profile />
                    <div className={content.blockFast}>
                        <div className={content.item}><p>My posts</p></div>
                        <div className={content.textPole}>
                            <textarea></textarea>
                        </div>
                        <div className={content.buttonAdd}>
                            <button>Send</button>
                        </div>
                    </div>
                    <post />
                    <post />
                    <post />
                    <post />
                    <post />
                    <post />
                    <post />
                </div>

            </content>
        );
        }
        export  default Content;
